<title>Coloriage</title>
<style>
html,body{

margin:0;

body{

user-select:none;
}
#div1{
font-family:mono,monospace;
position:fixed;
bottom:10px;
right:10px;
width:auto;
height:auto;
}
#svg1{
width:100%;
height:100%;
background:#f7f7f7;
}

#svg2{
position:fixed;
top:0px;
left:0px;
width:100px;
height:130px;
border-bottom:1px solid #ddd;
border-right:1px solid #ddd;
}
#svg2:hover{
animation: appear 1s forwards;
}
#svg2:not(:hover){
animation: disappear 1s forwards;
}
circle:active{
r:15px;
stroke-width:1;
}
@keyframes appear{
from {transform:translateX(-95px);}
to {transform:translateX(0px);}
}
@keyframes disappear{
from {transform:translateX(0px);}
to {transform:translateX(-95px);}
}
</style>
